  /**
   * Gets location inputted by user
   */
  getLocation = async(place) => {
    const request_url = `https://api.opencagedata.com/geocode/v1/json?q=${place}&key=fc4039d974c24ec5a148b6eece4ea36b'`;
    const api_call = await fetch(request_url);
    const data = await api_call.json;
    console.log(data);
  }

  render() {
    return (
      <div>
        <Titles />
        <Form />
        <Sunset />
      </div>
    );
  }
};

export default App;
